import React, {Component} from 'react';
import Link from "next/link";
class Index extends Component {
    render() {
        return (
            <div>

                <ul>
                    <li><Link href="/"></Link>  </li>
                </ul>

                <h1>This is home page</h1>
            </div>
        );
    }
}

export default Index;
